const contentStyle = {
    height: '70vh',
    width:'50%'
};

export default function Home(){
    return(
    <div 
    //style={{display:'flex',flexDirection:'row',flexWrap:'wrap',justifyContent:'center', alignItems:'center'}}
    >
       <Carousel autoplay>
            <div>
                <img style={contentStyle} src="/1.jpg" alt="" />
            </div>
            <div>
            <img style={contentStyle} src="/2.jpg" alt="" />

            </div>
            <div>
            <img style={contentStyle} src="/3.jpg" alt="" />

            </div>
            <div>
            <img style={contentStyle} src="/4.jpg" alt="" />

            </div>
        </Carousel>
        </div>
    )
}
